import React from "react";

function Filter() {
  return (
    <div>
      <input type="text" placeholder="Filter by gender" />
      <input type="text" placeholder="Filter by hair color" />
      <input type="text" placeholder="Filter by years old" />
      <button>Filter</button>
    </div>
  );
}

export default Filter;
